webpackJsonp([0xe6d1355da3e5],{2624:function(e,t){e.exports={pathContext:{docHtml:'<h1>fsevents <a href="https://nodei.co/npm/fsevents/"><img src="https://nodei.co/npm/fsevents.png" alt="NPM"></a></h1>\n<p>Native access to OS X FSEvents in <a href="http://nodejs.org/">Node.js</a></p>\n<p>The FSEvents API in OS X allows applications to register for notifications of\nchanges to a given directory tree. It is a very fast and lightweight alternative\nto kqueue.</p>\n<p>This is a low-level library. For a cross-compatible file watching module that\nuses fsevents, check out <a href="https://www.npmjs.com/package/chokidar">Chokidar</a>.</p>\n<ul>\n<li><a href="https://github.com/strongloop/fsevents">Module Site &#x26; GitHub</a></li>\n<li><a href="https://npmjs.org/package/fsevents">NPM Page</a></li>\n</ul>\n<h2>Installation</h2>\n<pre><code>$ npm install fsevents\n</code></pre>\n<h2>Usage</h2>\n<pre><code class="language-js">var fsevents = require(\'fsevents\');\nvar watcher = fsevents(__dirname);\nwatcher.on(\'fsevent\', function(path, flags, id) { }); // RAW Event as emitted by OS-X\nwatcher.on(\'change\', function(path, info) { }); // Common Event for all changes\nwatcher.start() // To start observation\nwatcher.stop()  // To end observation\n</code></pre>\n<h3>Events</h3>\n<ul>\n<li><em>fsevent</em> - RAW Event as emitted by OS-X</li>\n<li><em>change</em> - Common Event for all changes</li>\n<li><em>created</em> - A File-System-Item has been created</li>\n<li><em>deleted</em> - A File-System-Item has been deleted</li>\n<li><em>modified</em> - A File-System-Item has been modified</li>\n<li><em>moved-out</em> - A File-System-Item has been moved away from this location</li>\n<li><em>moved-in</em> - A File-System-Item has been moved into this location</li>\n</ul>\n<p>All events except <em>fsevent</em> take an <em>info</em> object as the second parameter of the callback. The structure of this object is:</p>\n<pre><code class="language-js">{\n  "event": "&#x3C;event-type>",\n  "id": &#x3C;eventi-id>,\n  "path": "&#x3C;path-that-this-is-about>",\n  "type": "&#x3C;file|directory|symlink>",\n  "changes": {\n    "inode": true, // Has the iNode Meta-Information changed\n    "finder": false, // Has the Finder Meta-Data changed\n    "access": false, // Have the access permissions changed\n    "xattrs": false // Have the xAttributes changed\n  },\n  "flags": &#x3C;raw-flags>\n}\n</code></pre>\n<h2>MIT License</h2>\n<p>Copyright (C) 2010-2014 Philipp Dunkel</p>\n<p>Permission is hereby granted, free of charge, to any person obtaining a copy\nof this software and associated documentation files (the "Software"), to deal\nin the Software without restriction, including without limitation the rights\nto use, copy, modify, merge, publish, distribute, sublicense, and/or sell\ncopies of the Software, and to permit persons to whom the Software is\nfurnished to do so, subject to the following conditions:</p>\n<p>The above copyright notice and this permission notice shall be included in\nall copies or substantial portions of the Software.</p>\n<p>THE SOFTWARE IS PROVIDED "AS IS", WITHOUT WARRANTY OF ANY KIND, EXPRESS OR\nIMPLIED, INCLUDING BUT NOT LIMITED TO THE WARRANTIES OF MERCHANTABILITY,\nFITNESS FOR A PARTICULAR PURPOSE AND NONINFRINGEMENT. IN NO EVENT SHALL THE\nAUTHORS OR COPYRIGHT HOLDERS BE LIABLE FOR ANY CLAIM, DAMAGES OR OTHER\nLIABILITY, WHETHER IN AN ACTION OF CONTRACT, TORT OR OTHERWISE, ARISING FROM,\nOUT OF OR IN CONNECTION WITH THE SOFTWARE OR THE USE OR OTHER DEALINGS IN\nTHE SOFTWARE.</p>',docPath:"argo-ci/node_modules/fsevents/readme",proj:"argo-ci"}}}});
